示例代码：
NSArray * array = [[MXCircle sharedInstance] getJoinedGroupArray];
NSDictionary * dic=array[0];
int groupID=array[0]@["groupID"];
[[MXCircle sharedInstance]setCurrentGroup:groupID];
[[MXCircle sharedInstance]froceRefrushCircle];

