[[MXNetModel shareNetModel] startRequset:@"GET" withURL:"" withParams:nil withHeaders:nil withIndicator:YES withCallback:^(id object, MXError *error) {
 //handle callback        
 if(object && !error) {
   //处理response
    } else {
    //出错处理
   }
 }];
